Коротко обо мне:

Родился 21 августа 1986 года в 16.25 в Ленинграде.
Мирское имя – Виктор, духовное Яросвет.

✅ Маг;
✅ Шаман;
✅ Целитель;
✅ Парапсихолог;
✅ Магистр космоэнергетики;
✅ Мастер кундалини-рейки 12 ступени;
✅ Проводник энергоинформационных каналов славянских Богов;
✅ Проводник к Абсолюту;

С 11 лет встал на путь саморазвития и самопознания. Обладаю врождённой способностью ясновидения, яснослышания и яснознания.

Сейчас помогаю воинам света ВСПОМНИТЬ СЕБЯ НАСТОЯЩИМИ.

Познакомиться со мной можно на бесплатной консультации по видеосвязи в Telegram или WhatsApp. Записаться на консультацию можно через контакты указанные ниже:

